	/**
	 * @responder wpjson
	 */
	public function xhr_icon_family(){
		if(!isset($this->boundle[$this->getParam('family')])){
			if($this->getParam('family') === 'all'){
				$families = array();
				foreach($this->boundle as $id => $name){
					$families[$id] = array(
						'name' => $name,
						'style' => plugins_url('/assets/icons/'.$id.'/style.css', dirname(dirname(CpPress::$FILE))),
						'icons' => unserialize($this->filter[$id])
					);
				}
				
				return $families;
			}
			
			return array();
		}
		$style = plugins_url('/assets/icons/'.$this->getParam('family').'/style.css', dirname(dirname(CpPress::$FILE)));
		$family = $this->boundle[$this->getParam('family')];
		return array(
			'name' => $family,
			'style' => $style,
			'icons' => unserialize($this->filter[$this->getParam('family')])
		);
		
	}
	
	public function icon_button($id, $name, $value, $color, $class, $iconPosition, $visible=true){
		$icons = array();
		foreach($this->boundle as $family => $fname){
			$icons[$family] = array(
				'name' => $fname,
				'iconscount' => count(unserialize($this->filter[$family]))
			);
		}
		$this->assign('value_family', 'fontawesome');
		$this->assign('icon_families', $icons);
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('value', $value);
		$this->assign('color', $color);
		$this->assign('class', $class);
        $this->assign('icon_position', $iconPosition);
		$this->assign('visible', $visible);
	}
	
	public function media_button($id, $name, $media, $external, $video=false){
		$removeClass = 'remove-hide';
		if($media != ''){
			$image = new Image();
			$image->set($media);
			$this->assign('image', $image->getImage($media, array(150, 150)));
			$this->assign('image_title', $image->getTitle($media));
			$removeClass = '';
		}
		if(!$video){
			$this->assign('library', 'image');
			$this->assign('lib_title', __('Image file', 'cppress'));
		}else{
			$this->assign('library', 'video');
			$this->assign('lib_title', __('Video file', 'cppress'));
		}
		if(isset($name['libtitle'])){
			$this->assign('lib_title', $name['libtitle']);
		}
		$this->assign('remove', $removeClass);
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('media', $media);
		$this->assign('external', $external);
	}
	
	public function link_button($id, $name, $value, $validTypes=array()){
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('value', $value);
		$this->assign('valid_types', esc_attr(json_encode($validTypes)));
	}
	
	public function repeater($id, $name, $values, $actions, $title, $itemTitle, $events=null){
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('values', esc_attr(json_encode($values)));
		$this->assign('actions', esc_attr(json_encode($actions)));
		$this->assign('events', esc_attr(json_encode($events)));
		$this->assign('title', $title);
		$this->assign('item_title', $itemTitle);
	}
	
	public function accordion($title, $accordions, $data, $bodies, $field){
		if(empty($field['value'])){
			$field['value'][$data[0]] = true;
		}
		$this->assign('title', $title);
		$this->assign('data', $data);
		$this->assign('field', $field);
		$this->assign('accordions', $accordions);
		$this->assign('bodies', $bodies);
	}
	
	public function editor($id, $value, $settings, $widget = null){
		$default = array(
			'teeny' => false,
			'media_buttons' => false,
			'editor_height' => 230,
			'editor_class' => 'cp-widget-input'
		);
		$settings = wp_parse_args($settings, $default);
		$editor = new Editor($widget);
		$editor->init($id . uniqid(), $value, $settings, $this->backEndFilter);
		$this->assign('editor', $editor);
	}
	
