	public function getFontAssets(){
		$assets = array();
		foreach($this->boundle as $asset => $msg){
			$assets[$asset] = plugins_url('/assets/icons/'.$asset.'/style.css', dirname(dirname(CpPress::$FILE)));
		}
		
		return $assets;
	}
	
	public function fonts($id, $name, $value=''){
		// Add the default fonts
		$fontFamilies = array(
				'Helvetica Neue' => 'Helvetica Neue',
				'Lucida Grande' => 'Lucida Grande',
				'Georgia' => 'Georgia',
				'Courier New' => 'Courier New',
		);
		$gFonts = unserialize(self::$googleFonts);
		
		foreach($gFonts as $font => $variants){
			foreach($variants as $variant){
				if($variant === 'regular' || $variant === 400){
					$fontFamilies[$font] = $font;
				}else{
					$fontFamilies[$font . ':' . $variant] = $font . ' (' . $variant . ')';
				}
			}
		}
		
		
		$this->assign('fonts', $fontFamilies);
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('value', $value);
	}
	
