	 */
	public function xhr_gmap_customstyles($editor){
		$id = $this->getParam( 'id' );
		$name = $this->getParam( 'name' );
		$count = $this->getParam('count');
		$this->assign('values', $this->getParam('values', array()));
		$this->assign('id', $id);
		$this->assign('name', $name);
		$this->assign('count', $count);
		$this->assign('gmapsStyleOptions', $this->gmapsStyleOptions);
	}
	
	
	
	/** STATIC */
	public static function getLinkArgs($val){
		if(preg_match("/([a-zA-Z]*):\s([0-9]+)/", $val, $match)){
			return array(
				'p' => $match[2],
				'post_type' => $match[1] 
			);
		}else{
			return array();
		}
	}

	public static function isLinkArgs($val){
	    return preg_match("/([a-zA-Z]*):\s([0-9]+)/", $val);
    }
	
	public static function getLinkPermalink($val){
	    if(self::isLinkArgs($val)){
            $args = self::getLinkArgs($val);
            return get_permalink($args['p']);
        }

        return $val;
	}
	
	public static function isGoogleWebFont($fontValue){
		$googleWebFonts = unserialize(self::$googleFonts);
		$fontFamily = explode(':', $fontValue);
		$fontFamily = $fontFamily[0];
		
		return isset($googleWebFonts[$fontFamily]);
	}
	
	public static function getFont($fontValue){
		$webSafe = array(
				'Helvetica Neue' => 'Arial, Helvetica, Geneva, sans-serif',
				'Lucida Grande' => 'Lucida, Verdana, sans-serif',
				'Georgia' => '"Times New Roman", Times, serif',
				'Courier New' => 'Courier, mono',
				'default' => 'default',
		);
		
		$font = array();
		if(isset($webSafe[$fontValue])){
			$font['family'] = $webSafe[$fontValue];
		}else if(self::isGoogleWebFont($fontValue)){
			$fontParts = explode(':', $fontValue);
			$font['family'] = $fontParts[0];
			$fontUrlParam = urlencode($fontParts[0]);
			if(count($fontParts) > 1){
				$font['weight'] = $fontParts[1];
				$fontUrlParam .= ':' . $fontParts[1];
			}
			$font['css_import'] = '@import url(http' . (is_ssl() ? 's' : '') . '://fonts.googleapis.com/css?family=' . $fontUrlParam . ');';
		}else{
			$font['family'] = $fontValue;
		}
		
		return $font;
	}

